response.about:
Привет! Я создатель студии персональных тренировок «Три подхода». В ней я провожу  тренировки различных направлений, в том числе реабилитационные. 

Уже не первый год я помогаю людям достигать их целей. 

Я работаю с разными случаями: 
— ДЦП;
— Травмы спины и конечностей;
— Уменьшение веса; 
— Увеличение силы, выносливости;
— Спортивная подготовка; 

К каждому применяется уникальный подход, в зависимости от общего состояния человека.

Мои обширные знания всегда обеспечивают каждому моему подопечному поступательное движение вперёд, к здоровому образу жизни. Некоторыми из этих знаний я с удовольствием делюсь в социальных сетях.
